import React from 'react';
import { TextField,Grid, Button } from '@material-ui/core';

export default class HobyList extends React.Component{
    state = { arrList: [], hobby: ""};
    addToList = (e: any) => {
        e.preventDefault();
        this.setState({
            arrList: [...this.state.arrList, e],
            hobby: ""
        });
    }
    render() {
        return (
            <div>
                <Grid container justify="center">
                    <form>
                        <TextField id="standard-basic" onChange={(e) => this.setState({hobby: e.target.value})} label="Type your hobbies" />
                        <Button type="submit" onClick={(e) => {this.addToList(e); console.log(this.state)}}>+</Button>
                        </form>
                    </Grid>
            </div>
        )
    }
}
